import { Box, Heading } from "@chakra-ui/react";
import React from "react";
import ProjectChild from "../Components/Projectchild";
import {
  FaDharmachakra,
  FaHtml5,
  FaCss3Alt,
  FaJsSquare,
  FaReact,
} from "react-icons/fa";
import { DiAtom, DiNodejsSmall } from "react-icons/di";
import {
  SiExpress,
  SiPostman,
  SiMongodb,
  SiGithub,
  SiNpm,
  SiCanva,
  SiNetlify,
  SiReplit,
  SiVisualstudiocode,
  SiNotion,
  SiCodesandbox,
  SiJson,
} from "react-icons/si";

const Projects = () => {
  const fashionPointLink = [
    // HTML | CSS | JS | MockAPI
    { icon: FaReact, title: "React JS" },
    { icon: FaDharmachakra, title: "Chakra UI" },
    { icon: SiJson, title: "JSON Server" },
  ];
  // const codebopk2Link = [
  //   // HTML | CSS | JS | MockAPI
  //   { icon: FaReact, title: "React JS" },
  //   { icon: FaDharmachakra, title: "Chakra UI" },
  //   { icon: SiJson, title: "JSON Server" },
  // ];
  const fashionPointText = {
    title: "FASHION POINT - Clone",
    desc: "  It is a E-Commerce website. There are many items available",
    deploy: "https://cute-cobbler-edfe4e.netlify.app/",
    gitRepo: "https://github.com/bire210/spiky-plate-7313",
    image: 'https://cdn4.vectorstock.com/i/1000x1000/47/28/project-management-concept-for-website-template-vector-25014728.jpg',
    feature: [
      "  User can Login or Signup",
      "Home page",
      "Product Page",
      "",
      "Filtering on Products",
      "Authentication",
      "Payment Option",
    ],
  };
  return <Box overflow={'hidden'}>
    <Heading>Projects</Heading>
      <ProjectChild techStack={fashionPointLink} project={fashionPointText} />
      <ProjectChild techStack={codebopk2Link} project={codeBookText} />
  </Box>
};

export default Projects;
